import React from "react";

import { lpInfo } from "../data";
function Lp() {
  return (
    <>
      <div className="about-area" >
        <div className="container">
          {lpInfo.map((item) => (
            <iframe
              src={item.src}
              title={item.title}
              frameborder="0"
              allow="accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture"
              allowfullscreen
            ></iframe>
          ))}
        </div>
      </div>
    </>
  );
}

export default Lp;
